import React from 'react';
import logo from './logo.svg';
import './App.css';
import RegisterForm from "./components/form/RegisterForm";
import { Form } from 'antd';
function App() {
    const RegisterForm = Form.create()(RegisterForm);
    return (

        <div className="App">
            <h1>Form Register</h1>
            <RegisterForm></RegisterForm>
        </div>
    );
}

export default App;
